package br.com.tipy.hortifruti.image;

import java.io.BufferedOutputStream;
import java.io.File;
import java.io.FileOutputStream;
import java.io.IOException;
import java.io.OutputStream;

public class ImageBase64Img {

	public void base64ToFile(String base64Image) throws IOException {

		byte[] imageBytes = javax.xml.bind.DatatypeConverter.parseBase64Binary(base64Image);

//		BufferedImage img = ImageIO.read(new ByteArrayInputStream(imageBytes));
		File file = new File("temp/images/img.png");
		try (OutputStream outputStream = new BufferedOutputStream(new FileOutputStream(file))) {
			outputStream.write(imageBytes);
		} catch (IOException e) {
			e.printStackTrace();
		}
	}

	public void fileToBase64() {

	}
	
	
	public static void main(String[] args) throws IOException {
		System.out.println("init");
		ImageBase64Img i = new ImageBase64Img();
		i.base64ToFile("");
		System.out.println("end");
	}
}
